import React from "react";
import "./style.css";




function Login(){    

    return (
        <div>
            <form className="form">
                <h1>Login</h1>
                <input placeholder ="Enter userame" type="text"            
                />
                <br/>
                <br/>
                <input placeholder ="Enter password" type="password"                
                />                       
                <br/>
                <br/>
                <button type ="submit">Login</button>

            </form>


        </div>
    )
}

export default Login;
